import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';

const LocationPage = () => {
  const { id } = useParams();  // Get location ID from URL
  const [location, setLocation] = useState(null);
  const [reviews, setReviews] = useState([]);
  const [review, setReview] = useState({ rating: '', description: '' });
  const [error, setError] = useState(null);

  // Fetch location details and reviews
  useEffect(() => {
    const fetchLocation = async () => {
      try {
        const locationResponse = await axios.get(`http://localhost:8081/api/locations/${id}`);
        setLocation(locationResponse.data);

        const reviewsResponse = await axios.get(`http://localhost:8081/api/reviews/location/${locationResponse.data.locationName}`);
        setReviews(reviewsResponse.data);
      } catch (error) {
        setError("Error fetching location or reviews");
      }
    };
    fetchLocation();
  }, [id]);

  const handleReviewSubmit = async (e) => {
    e.preventDefault();

    try {
      const user = JSON.parse(localStorage.getItem('user')); // Assuming user info is stored in localStorage
      const newReview = {
        username: user.username,
        rating: review.rating,
        description: review.description,
      };

      const response = await axios.post(`http://localhost:8081/api/locations/${id}/review`, newReview);
      alert("Review added successfully!");
      setReviews([...reviews, response.data.review]); // Add the new review to the list of reviews
      setReview({ rating: '', description: '' });
    } catch (error) {
      setError("Error adding review");
    }
  };

  if (error) {
    return <div>{error}</div>;
  }

  if (!location) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>{location.locationName}</h1>
      <p><strong>Created by:</strong> {location.username}</p>
      <p><strong>Location Type:</strong> {location.locationType}</p>
      <p><strong>Address:</strong> {location.address}</p>
      <p><strong>Description:</strong> {location.description}</p>

      <hr />

      <h2>Reviews</h2>
      {reviews.length > 0 ? (
        reviews.map((review) => (
          <div key={review._id}>
            <p><strong>{review.username}</strong> ({review.rating} stars)</p>
            <p>{review.description}</p>
          </div>
        ))
      ) : (
        <p>No reviews yet.</p>
      )}

      <hr />

      <h2>Write a Review</h2>
      <form onSubmit={handleReviewSubmit}>
        <div>
          <label>Rating:</label>
          <input
            type="number"
            value={review.rating}
            onChange={(e) => setReview({ ...review, rating: e.target.value })}
            min="1"
            max="5"
            required
          />
        </div>
        <div>
          <label>Comment:</label>
          <textarea
            value={review.description}
            onChange={(e) => setReview({ ...review, description: e.target.value })}
            required
          />
        </div>
        <button type="submit">Submit Review</button>
      </form>
    </div>
  );
};

export default LocationPage;
